/* START CODE */

// Include the necessary libraries
#include <EasyButton.h>
#include <MCP3208.h>

// Define the push button pins
const uint8_t b1_PushButton_PIN_D2 = 2;
const uint8_t b2_PushButton_PIN_D3 = 3;

// Define the LED pin
const uint8_t led1_LED_PIN_D4 = 4;

// Create instances of the libraries
EasyButton button1(b1_PushButton_PIN_D2);
EasyButton button2(b2_PushButton_PIN_D3);
MCP3208 adc;

void setup() {
  // Initialize serial communication
  Serial.begin(9600);

  // Initialize the push buttons as input with pull-up
  pinMode(b1_PushButton_PIN_D2, INPUT_PULLUP);
  pinMode(b2_PushButton_PIN_D3, INPUT_PULLUP);

  // Initialize the LED pin as output
  pinMode(led1_LED_PIN_D4, OUTPUT);

  // Initialize ADC
  adc.begin(); // default CS pin 10
  adc.analogReadResolution(12); // set ADC resolution to 12 bits
}

void loop() {
  // Read the state of the push buttons
  bool button1State = digitalRead(b1_PushButton_PIN_D2) == LOW; // active low
  bool button2State = digitalRead(b2_PushButton_PIN_D3) == LOW; // active low

  // Check if both buttons are pressed
  if (button1State && button2State) {
    // Turn on the LED
    digitalWrite(led1_LED_PIN_D4, HIGH);
  } else {
    // Turn off the LED
    digitalWrite(led1_LED_PIN_D4, LOW);
  }

  // Read ADC channels if needed for further processing
  uint16_t channel0 = adc.analogRead(0);
  uint16_t channel1 = adc.analogRead(1);

  // Optional: send ADC readings to Serial for debugging
  Serial.print("Channel 0 Value: ");
  Serial.println(channel0);
  Serial.print("Channel 1 Value: ");
  Serial.println(channel1);

  delay(100); // Small delay to debounce buttons
}

/* END CODE */

using System;
using System.Collections.Generic;

namespace OOP_13
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Simulation simulation = new Simulation();
            simulation.Run();
        }
    }

    public class Part
    {
        public Part(string name, decimal price, decimal workPrice)
        {
            Name = name;
            Price = price;
            WorkPrice = workPrice;
        }

        public string Name { get; }
        public decimal Price { get; }
        public decimal WorkPrice { get; }

        public override bool Equals(object obj)
        {
            return obj is Part part && Name == part.Name;
        }

        public override int GetHashCode()
        {
            return Name.GetHashCode();
        }

        public override string ToString()
        {
            return $"{Name} (–¶–µ–Ω–∞: {Price}—Ä, –†–∞–±–æ—Ç–∞: {WorkPrice}—Ä)";
        }
    }

    public class CarPart
    {
        public CarPart(Part partDefinition, bool isBroken = false)
        {
            PartDefinition = partDefinition;
            IsBroken = isBroken;
        }

        public Part PartDefinition { get; }
        public bool IsBroken { get; set; }

        public override string ToString()
        {
            string status = IsBroken ? "–°–õ–û–ú–ê–ù–ê" : "–¶–ï–õ–ê–Ø";
            return $"{PartDefinition.Name} [{status}]";
        }
    }

    public class Car
    {
        public Car(string model)
        {
            Model = model;
        }

        public string Model { get; }
        public List<CarPart> Parts { get; } = new List<CarPart>();

        public void AddPart(CarPart part)
        {
            Parts.Add(part);
        }

        public List<CarPart> GetBrokenParts()
        {
            List<CarPart> brokenParts = new List<CarPart>();

            foreach (CarPart part in Parts)
            {
                if (part.IsBroken)
                {
                    brokenParts.Add(part);
                }
            }

            return brokenParts;
        }

        public bool IsFullyRepaired()
        {
            foreach (CarPart part in Parts)
            {
                if (part.IsBroken)
                {
                    return false;
                }
            }

            return true;
        }

        public void PrintStatus()
        {
            const int LineWidth = 20;

            Console.WriteLine($"\n--- –ú–∞—à–∏–Ω–∞: {Model} ---");
            Console.WriteLine("–°–æ—Å—Ç–æ—è–Ω–∏–µ –¥–µ—Ç–∞–ª–µ–π:");

            for (int i = 0; i < Parts.Count; i++)
            {
                Console.WriteLine($"  {i + 1}. {Parts[i]}");
            }

            Console.WriteLine(new string('-', LineWidth));
        }
    }

    public class Warehouse
    {
        private Dictionary<Part, int> _stock = new Dictionary<Part, int>();

        public void AddStock(Part part, int quantity)
        {
            if (_stock.ContainsKey(part))
            {
                _stock[part] += quantity;
            }
            else
            {
                _stock[part] = quantity;
            }

            Console.WriteLine($"[–°–∫–ª–∞–¥] –î–æ–±–∞–≤–ª–µ–Ω–æ: {part.Name} (x{quantity}). –í—Å–µ–≥–æ –Ω–∞ —Å–∫–ª–∞–¥–µ: {_stock[part]}");
        }

        public bool HasPart(Part part)
        {
            return _stock.ContainsKey(part) && _stock[part] > 0;
        }

        public bool TakePart(Part part)
        {
            if (HasPart(part))
            {
                _stock[part]--;
                Console.WriteLine($"[–°–∫–ª–∞–¥] –í–∑—è—Ç–∞ –¥–µ—Ç–∞–ª—å: {part.Name}. –û—Å—Ç–∞–ª–æ—Å—å: {_stock[part]}");

                return true;
            }

            Console.WriteLine($"[–°–∫–ª–∞–¥] –û–®–ò–ë–ö–ê: –î–µ—Ç–∞–ª–∏ '{part.Name}' –Ω–µ—Ç –Ω–∞ —Å–∫–ª–∞–¥–µ.");
            return false;
        }

        public void PrintStock()
        {
            const int LineWidth = 20;

            Console.WriteLine("--- –°–æ—Å—Ç–æ—è–Ω–∏–µ —Å–∫–ª–∞–¥–∞ ---");

            if (_stock.Count == 0)
            {
                Console.WriteLine("–°–∫–ª–∞–¥ –ø—É—Å—Ç.");
                return;
            }

            foreach (var entry in _stock)
            {
                Console.WriteLine($"{entry.Key.Name}: {entry.Value} —à—Ç.");
            }

            Console.WriteLine(new string('-', LineWidth));
        }
    }

    public class AutoService
    {
        private const decimal RefusalFineBefore = 500m;
        private const decimal RefusalFinePerPart = 150m;

        private Queue<Car> _carQueue = new Queue<Car>();

        public AutoService(decimal initialBalance)
        {
            Balance = initialBalance;
            Console.WriteLine($"–ê–≤—Ç–æ—Å–µ—Ä–≤–∏—Å –æ—Ç–∫—Ä—ã—Ç! –ù–∞—á–∞–ª—å–Ω—ã–π –±–∞–ª–∞–Ω—Å: {Balance}—Ä.");
        }

        public decimal Balance { get; private set; }

        public Warehouse Warehouse { get; } = new Warehouse();

        public void AddCarToQueue(Car car)
        {
            _carQueue.Enqueue(car);
            Console.WriteLine($"[–û—á–µ—Ä–µ–¥—å] –ú–∞—à–∏–Ω–∞ '{car.Model}' –¥–æ–±–∞–≤–ª–µ–Ω–∞ –≤ –æ—á–µ—Ä–µ–¥—å.");
        }

        public void ServeNextCar()
        {
            const string AgreeRepairCommand = "1";
            const string RefuseRepairsCommand = "2";
            
            // bool isRunning = true;

            if (_carQueue.Count == 0)
            {
                Console.WriteLine("–í –æ—á–µ—Ä–µ–¥–∏ –Ω–µ—Ç –º–∞—à–∏–Ω. –°–µ—Ä–≤–∏—Å –æ—Ç–¥—ã—Ö–∞–µ—Ç.");

                return;
            }

            Car currentCar = _carQueue.Dequeue();
            
            Console.WriteLine($"\n======= –ù–∞—á–∏–Ω–∞–µ–º –æ–±—Å–ª—É–∂–∏–≤–∞–Ω–∏–µ –º–∞—à–∏–Ω—ã: {currentCar.Model} =======");
            currentCar.PrintStatus();
            Console.WriteLine("–ß—Ç–æ –¥–µ–ª–∞–µ–º —Å –º–∞—à–∏–Ω–æ–π?");
            Console.WriteLine($"{AgreeRepairCommand}. –ù–∞—á–∞—Ç—å —Ä–µ–º–æ–Ω—Ç");
            Console.WriteLine($"{RefuseRepairsCommand}. –û—Ç–∫–∞–∑–∞—Ç—å—Å—è –æ—Ç —Ä–µ–º–æ–Ω—Ç–∞ (–®—Ç—Ä–∞—Ñ: " + RefusalFineBefore + "—Ä)");

            string choice = Console.ReadLine();

            StartRepairProcess(currentCar);

            if (choice == RefuseRepairsCommand)
            {
                HandleRefusal(currentCar, true);
                return;
            }
        }

        public void PrintServiceStatus()
        {
            const int LineWidth = 20;

            Console.WriteLine("\n===== –°–¢–ê–¢–£–° –ê–í–¢–û–°–ï–†–í–ò–°–ê =====");
            Console.WriteLine($"–¢–µ–∫—É—â–∏–π –±–∞–ª–∞–Ω—Å: {Balance}—Ä.");
            Console.WriteLine($"–ú–∞—à–∏–Ω –≤ –æ—á–µ—Ä–µ–¥–∏: {_carQueue.Count}");
            Warehouse.PrintStock();
            Console.WriteLine(new string('=', LineWidth));
        }

        private void StartRepairProcess(Car car)
        {
            const string RefuseRepairsCommand = "0";

            bool repairInProgress = true;

            while (repairInProgress && car.IsFullyRepaired() == false)
            {
                Console.WriteLine("\n--- –ü—Ä–æ—Ü–µ—Å—Å —Ä–µ–º–æ–Ω—Ç–∞ ---");
                car.PrintStatus();

                Console.WriteLine("–î–æ—Å—Ç—É–ø–Ω—ã–µ –¥–µ—Ç–∞–ª–∏ –¥–ª—è –∑–∞–º–µ–Ω—ã (–≤–≤–µ–¥–∏—Ç–µ –Ω–æ–º–µ—Ä):");
                
                for (int i = 0; i < car.Parts.Count; i++)
                {
                    Console.WriteLine($"  {i + 1}. {car.Parts[i]}");
                }
                
                Console.WriteLine($"{RefuseRepairsCommand}. –û—Ç–∫–∞–∑–∞—Ç—å—Å—è –æ—Ç —Ä–µ–º–æ–Ω—Ç–∞ (–®—Ç—Ä–∞—Ñ –∑–∞ –Ω–µ–ø–æ—á–∏–Ω–µ–Ω–Ω—ã–µ –¥–µ—Ç–∞–ª–∏)");

                if (int.TryParse(Console.ReadLine(), out int partIndex) == false || partIndex < 0 || partIndex > car.Parts.Count)
                {
                    Console.WriteLine("–ù–µ–≤–µ—Ä–Ω—ã–π –≤–≤–æ–¥. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ —Å–Ω–æ–≤–∞.");
                    continue;
                }

                if (partIndex == 0)
                {
                    HandleRefusal(car, false);
                    repairInProgress = false;
                    continue; 
                }

                CarPart selectedPart = car.Parts[partIndex - 1];
                Part partTypeToReplace = selectedPart.PartDefinition;

                if (Warehouse.HasPart(partTypeToReplace) == false)
                {
                    Console.WriteLine($"–û–®–ò–ë–ö–ê: –î–µ—Ç–∞–ª–∏ '{partTypeToReplace.Name}' –Ω–µ—Ç –Ω–∞ —Å–∫–ª–∞–¥–µ! –í—ã–±–µ—Ä–∏—Ç–µ –¥—Ä—É–≥—É—é –¥–µ—Ç–∞–ª—å.");
                    continue;
                }

                Warehouse.TakePart(partTypeToReplace);

                if (selectedPart.IsBroken)
                {
                    decimal payment = partTypeToReplace.Price + partTypeToReplace.WorkPrice;
                    Balance += payment;
                    selectedPart.IsBroken = false;

                    Console.WriteLine($"–£–°–ü–ï–•: –î–µ—Ç–∞–ª—å '{partTypeToReplace.Name}' –∑–∞–º–µ–Ω–µ–Ω–∞.");
                    Console.WriteLine($"–ü–æ–ª—É—á–µ–Ω–æ {payment}—Ä. (–î–µ—Ç–∞–ª—å: {partTypeToReplace.Price}—Ä, –†–∞–±–æ—Ç–∞: {partTypeToReplace.WorkPrice}—Ä)");
                    Console.WriteLine($"–ù–æ–≤—ã–π –±–∞–ª–∞–Ω—Å —Å–µ—Ä–≤–∏—Å–∞: {Balance}—Ä.");
                }
                else
                {
                    Console.WriteLine($"–í–ù–ò–ú–ê–ù–ò–ï: –ó–∞–º–µ–Ω–µ–Ω–∞ —Ü–µ–ª–∞—è –¥–µ—Ç–∞–ª—å '{partTypeToReplace.Name}'. –û–ø–ª–∞—Ç–∞ –Ω–µ –≤–∑–∏–º–∞–µ—Ç—Å—è.");
                }
            }

            if (car.IsFullyRepaired())
            {
                Console.WriteLine($"\n======= –†–ï–ú–û–ù–¢ –ó–ê–í–ï–†–®–ï–ù: {car.Model} =======");
                Console.WriteLine("–í—Å–µ –¥–µ—Ç–∞–ª–∏ –∏—Å–ø—Ä–∞–≤–Ω—ã. –ú–∞—à–∏–Ω–∞ –≥–æ—Ç–æ–≤–∞!");
            }

            Console.WriteLine($"–ò—Ç–æ–≥–æ–≤—ã–π –±–∞–ª–∞–Ω—Å —Å–µ—Ä–≤–∏—Å–∞: {Balance}—Ä.");
        }

        private void HandleRefusal(Car car, bool beforeRepair)
        {
            if (beforeRepair)
            {
                Balance += RefusalFineBefore;
                Console.WriteLine($"[–û—Ç–∫–∞–∑] –ö–ª–∏–µ–Ω—Ç –æ—Ç–∫–∞–∑–∞–ª—Å—è –¥–æ —Ä–µ–º–æ–Ω—Ç–∞. –®—Ç—Ä–∞—Ñ {RefusalFineBefore}—Ä. –ë–∞–ª–∞–Ω—Å: {Balance}—Ä.");
            }
            else
            {
                int brokenPartsCount = car.GetBrokenParts().Count;
                decimal fine = brokenPartsCount * RefusalFinePerPart;
                Balance += fine;

                Console.WriteLine($"[–û—Ç–∫–∞–∑] –ö–ª–∏–µ–Ω—Ç –æ—Ç–∫–∞–∑–∞–ª—Å—è –≤–æ –≤—Ä–µ–º—è —Ä–µ–º–æ–Ω—Ç–∞. –ù–µ–ø–æ—á–∏–Ω–µ–Ω–Ω—ã—Ö –¥–µ—Ç–∞–ª–µ–π: {brokenPartsCount}.");
                Console.WriteLine($"–®—Ç—Ä–∞—Ñ {fine}—Ä. –ë–∞–ª–∞–Ω—Å: {Balance}—Ä.");
            }

            Console.WriteLine($"–ú–∞—à–∏–Ω–∞ '{car.Model}' –ø–æ–∫–∏–¥–∞–µ—Ç —Å–µ—Ä–≤–∏—Å.");
        }
    }

    public class Simulation
    {
        private readonly AutoService _autoService;
        private readonly Part _engine;
        private readonly Part _wheel;
        private readonly Part _sparkPlug;

        public Simulation()
        {
            _engine = new Part("–î–≤–∏–≥–∞—Ç–µ–ª—å", 50000m, 10000m);
            _wheel = new Part("–ö–æ–ª–µ—Å–æ", 5000m, 500m);
            _sparkPlug = new Part("–°–≤–µ—á–∞ –∑–∞–∂–∏–≥–∞–Ω–∏—è", 500m, 200m);
            _autoService = new AutoService(100000m);
        }

        public void Run()
        {
            SetupWarehouse();

            SetupCarQueue();

            _autoService.PrintServiceStatus();

            Console.WriteLine("\n>>> –ù–∞—á–∏–Ω–∞–µ–º –æ–±—Å–ª—É–∂–∏–≤–∞–Ω–∏–µ 1-–π –º–∞—à–∏–Ω—ã <<<");
            _autoService.ServeNextCar();

            Console.WriteLine("\n>>> –ù–∞—á–∏–Ω–∞–µ–º –æ–±—Å–ª—É–∂–∏–≤–∞–Ω–∏–µ 2-–π –º–∞—à–∏–Ω—ã <<<");
            _autoService.ServeNextCar();

            Console.WriteLine("\n>>> –ù–∞—á–∏–Ω–∞–µ–º –æ–±—Å–ª—É–∂–∏–≤–∞–Ω–∏–µ 3-–π –º–∞—à–∏–Ω—ã <<<");
            _autoService.ServeNextCar();

            Console.WriteLine("\n\n--- –°–ò–ú–£–õ–Ø–¶–ò–Ø –ó–ê–í–ï–†–®–ï–ù–ê ---");
            _autoService.PrintServiceStatus();

            Console.WriteLine("\n–ù–∞–∂–º–∏—Ç–µ Enter –¥–ª—è –≤—ã—Ö–æ–¥–∞.");
            Console.ReadLine();
        }

        private void SetupWarehouse()
        {
            _autoService.Warehouse.AddStock(_engine, 2);
            _autoService.Warehouse.AddStock(_wheel, 10);
            _autoService.Warehouse.AddStock(_sparkPlug, 50);
        }

        private void SetupCarQueue()
        {
            Car car1 = new Car("Volvo XC90");
            car1.AddPart(new CarPart(_engine, true));
            car1.AddPart(new CarPart(_wheel, false));
            car1.AddPart(new CarPart(_wheel, true));
            car1.AddPart(new CarPart(_wheel, false));
            car1.AddPart(new CarPart(_wheel, false));
            car1.AddPart(new CarPart(_sparkPlug, false));

            Car car2 = new Car("Lada Granta");
            car2.AddPart(new CarPart(_engine, false));
            car2.AddPart(new CarPart(_wheel, false));
            car2.AddPart(new CarPart(_sparkPlug, true));
            car2.AddPart(new CarPart(_sparkPlug, true));

            Car car3 = new Car("BMW X5");
            car3.AddPart(new CarPart(_engine, true));

            _autoService.AddCarToQueue(car1);
            _autoService.AddCarToQueue(car2);
            _autoService.AddCarToQueue(car3);
        }
    }
}
